INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('Microsoft', 'edward.foo.2015@smu.edu.sg', 'Microsoft Corporation', 0, 0, , 'Microsoft Corporation, incorporated on September 22, 1993, is a technology company. The company develops, licenses, and supports a range of software products, services and devices. The Company\'s segments include Productivity and Business Processes, Intelligent Cloud and More Personal Computing.\r\n										\r\n										\r\n																		', '6123 5598');
INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('Uber', 'xiaowei.koh.2015@smu.edu.sg', 'Uber Technologies Inc.', 0, 0, , 'Uber Technologies, Inc. provides e-commerce services for car hire. The Company offers a website that allows users to request a car for hire from any mobile device text message. Uber Technologies serves customers worldwide.\r\n										\r\n										', '62253157');
INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('Unilever', 'amanda.lim.2015@sis.smu.edu.sg', 'Unilever Singapore', 0, 0, , 'Unilever PLC is a fast-moving consumer goods (FMCG) company. The Company\'s segments include Personal Care, which primarily includes sales of skin care and hair care products, deodorants and oral care products; Foods, which primarily includes sales of soups, bouillons, sauces, snacks, mayonnaise, salad dressings, margarines and spreads; Home Care, which primarily includes sales of home care products, such as powders, liquids and capsules, soap bars and a range of cleaning products, and Refreshment, which primarily includes sales of ice cream and tea-based beverages. The Company\'s geographical segments include Asia/AMET/RUB, The Americas and Europe. Its brands include Axe, Dirt is Good (Omo), Dove, Family Goodness (Rama), Heartbrand (Wall\'s), Hellmann\'s, Knorr, Lipton, Lux, Magnum, Rexona, Sunsilk and Surf. The Company operates in more than 100 countries, selling its products in more than 190 countries. The Company operates approximately 310 factories in over 70 countries.\r\n										\r\n										', '6643 3000');
INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('ntucincome', 'amanda.lim.2015@smu.edu.sg', 'NTUC Income', 0, 0, , 'NTUC Income is the only insurance co-operative in Singapore. Established to make essential insurance accessible to all Singaporeans, we are now a leader in life, health and general insurance.\r\n										\r\n										\r\n										', '6788 1777');
INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('thenorthface', 'gqyang.2015@sis.smu.edu.sg', 'The North Face, Inc.', 0, 0, , 'The North Face, Inc. manufactures and supplies outdoor exploration apparel, footwear, equipment, and accessories for men and women. It offers jackets and vests, such as rainwear, softshells, fleeces, lifestyle products, and windwear. The company also provides tops, including hoodies and sweatshirts, casual tops, T-shirts, tanks and sports bras, baselayers, and sweaters. In addition, it offers bottoms, such as shorts; and accessories, including backpacks, hats and scarves, gloves, and socks. Further, the company provides shoes, such as winter boots and sandals; and equipment, including backpacks, technical packs, tents, luggage and duffels, and sleeping bags. It offers its products for various activities, such as training, running, hiking, climbing, skiing, and snowboarding. It offers its products through retail stores and online in the United States, Canada, Europe, the Asia Pacific, and Latin America. The North Face, Inc. was formerly known as TNF Holdings Company, Inc. and changed its name to The North Face, Inc. in June 1994. The company was founded in 1966 and is based in San Leandro, California. The North Face, Inc. operates as a subsidiary of V.F. Corporation.\r\n										\r\n										\r\n										\r\n										\r\n										\r\n										', '1-888-863-1968');
INSERT INTO `organization_accounts` (`username`, `email`, `companyName`, `needsSupport`, `offeringSupport`, `profilePicture`, `companyBio`, `contactDetails`) VALUES
('Timberland', 'gqyang.2015@smu.edu.sg', 'The Timberland Company', 0, 0, , 'Timberland LLC engages in the design, development, marketing, and distribution of footwear, apparel, and accessories products for men, women, and children in North America, Europe, and Asia. The company offers basic, premium, and sports boots comprising hikers; and handsewn oxfords, boat shoes, and casual footwear. It also provides outdoor performance footwear for outdoor recreationalists and enthusiasts for outdoor adventures. The company\'s apparel products line includes outdoor adventure and outdoor leisure, and sports apparel for men, women, and kids. In addition, it offers a range of accessories products, such as packs and travel gear, women?s handbags, belts, wallets, socks, headwear, gloves, watches, sunglasses, eyewear, ophthalmic frames, and various other small leather goods. The company provides its products under the Timberland, Timberland PRO, Timberland Boot Company, SmartWool, and howies brands. It markets its products through independent retailers, department stores, athletic stores, national retailers, and Timberland specialty stores, as well as through a mix of independent distributors, franchisees, and licensees. The company also sells its products through online at timberland.com and smartwool.com in the United States; timberlandonline.co.uk and howies.co.uk in the United Kingdom; and shop.timberland.co.jp in Japan.\r\n										', '603-772-9500');
