('Hello Motor', 'Motor', 'We Motor', 111, 'Algeria', 'edward', 'Edward Pte Ltd', 1, 0, 0, 'new', '2017-08-01 13:45:12', 0, ''),
('Targeted Product Campaigns at Elderly', 'We wish to roll out our financial products at a lower cost to Elderly. We require marketing experts to help us roll out products. The primary product we are planning to roll out is Eldershield\r\n\r\nEldershield:\r\nWe pay you a monthly disability benefit of up to $400 per month, for up to 72 months if you are incapable of performing at least three activities of daily living [1].\r\n\r\nThere are two schemes under ElderShield.\r\n\r\nBasic ElderShield 400, which was launched on 30 September 2007, offers increased coverage against severe disability.\r\nBasic ElderShield 300 is no longer available for new applications. Existing policyholders will continue to enjoy their coverage as long as premiums are paid till age 65.', 'We wish to roll out our financial products at a lower cost to Elderly', 22, 'Singapore', 'ntucincome', 'NTUC Income', 1, 0, 0, 'new', '2017-08-08 12:39:02', 0, ''),
('The Long Walk Home: A Film that Focuses on Social Causes', 'The Long Walk Home: A Film that Focuses on Social Causes begins by portraying the distance, both symbolic and literal, which exists presently between Singaporeans and the foreign workers from India.', 'Through community sourced funding, we wish to create a film on migrant workers', 20, 'Philippines', 'joleneteo', 'Unilever Singapore', 0, 1, 0, 'new', '2017-08-08 12:53:58', 0, ''),
('Melodia: A fundraising concert for kids', 'Greetings, I am Ethan Smith, a veteran musician. We are planning to create a fundraising concert for children, and aim to raise $40,000 to help fundraise for the construction of a new school in Germany.', 'We plan to create a fundraising concert for children, aim to raise $40,000', 25, 'Germany', 'happyman', NULL, 1, 0, 0, 'new', '2017-08-10 08:50:06', 0, ''),
('Fundraising Cooking show for kids', 'I am hosting a cooking show to fundraise for the construction of a school for kids.', 'I am hosting a cooking show to fundraise for the construction of a school for kids.', 20, 'Afghanistan', 'iwanttogive', NULL, 1, 0, 0, 'new', '2017-08-10 10:00:01', 0, '');
